class User {
  constructor(userID, ID, userType, name, sex, address, birthdate, phone) {
    this.userID = userID;
    this.ID = ID;
    this.userType = userType;
    this.name = name;
    this.sex = sex;
    this.address = address;
    this.birthdate = birthdate;
    this.phone = phone;
  }
}

class Record {
  constructor(
    PDSFID,
    taskName,
    taskType,
    submitter,
    turn,
    qt,
    score,
    directory
  ) {
    this.PDSFID = PDSFID;
    this.taskName = taskName;
    this.taskType = taskType;
    this.submitter = submitter;
    this.turn = turn;
    this.qt = qt;
    this.score = score;
    this.directory = directory;
  }
}

class QT {
  constructor(total_tup, dup_tup, null_ratio) {
    this.total_tup = total_tup;
    this.dup_tup = dup_tup;
    this.null_ratio = null_ratio;
  }
}

class AdminTask {
  constructor(taskID, name, desc, period, waiting, participants, passScore) {
    this.taskID = taskID;
    this.name = name;
    this.desc = desc;
    this.period = period;
    this.waiting = waiting;
    this.participants = participants;
    this.passScore = passScore;
  }
}

export { User, Record, QT, AdminTask };
